def isSubsequence(s: str, t: str):
    temp = ""
    for i in t:
        if i in s:
            temp +=i

    for i in s:
        x = temp.find(i)
        if x!=-1:
            temp = temp[x+1:]
        else:
            return False

    return True




print(isSubsequence("abc", "ahbgdc"))
print(isSubsequence("axc", "ahbgdc"))
print(isSubsequence("axc", ""))
print(isSubsequence("acb", "ahbgdc"))



